const request = require("supertest");
const { response } = require("../routes/auth");
const app = require("../routes/auth");

test("Caso 1", async () => {
  var test = request.agent(app);
  var response = await test
    .post("/user-new")
    .send({
      firstname: "",
      lastname: "Ruiz",
      email: "user7@hotmail.com",
      user_password: "1234567",
      cellphone: "3320768955",
      image:
        "",
    })
    .set("Accept", "application/json");
  expect(response.status).toBe(200);
});

